import React from 'react';
import Map from "mapmyindia-react";
import './App.css';
import {lat1,long1} from './location.js';
var lat,long;


function get(){
    lat=lat1;
    long=long1;
    console.log('lat='+lat+" long="+long);
    fetch('https://trackmebaby.herokuapp.com/db')
    .then(response=>response.json())
    .then(data=>{ lat=data.results[0].latitude;long=data.results[0].longitude; })

    return 1;
  }

function App() {
  if(get()){
  return (
    <Map
      markers={[
          { 
              position: [ parseFloat(lat) , parseFloat(long)],
              draggable: true, 
              title:"Am here!!",
          }
      ]}
      />
 );
    }


}


export default App;
